pub enum RawEntryMut<'a, K, V, S, A: Allocator + Clone = Global> {
    Occupied(RawOccupiedEntryMut),
    Vacant(RawVacantEntryMut),
}

pub enum Entry<'a, K, V, S, A = Global> where A: Allocator + Clone {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

pub enum EntryRef<'a, 'b, K, Q: ?Sized, V, S, A = Global> where A: Allocator +
         Clone {
    Occupied(OccupiedEntryRef),
    Vacant(VacantEntryRef),
}

pub enum Entry<'a, T, S, A = Global> where A: Allocator + Clone {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

pub enum TryReserveError {
    CapacityOverflow,
    AllocError {
        layout: alloc::alloc::Layout,
    },
}
